import { Component, OnInit } from '@angular/core';

interface Product {
  id: number;
  name: string;
  price: number;
  image: string;
  team: string;
}

@Component({
  selector: 'app-product-grid',
  standalone: true,
  templateUrl: './product-grid.component.html',
  styleUrls: ['./product-grid.component.css']
})
export class ProductGridComponent implements OnInit {
  products: Product[] = [];
  page = 1;
  pageSize = 12;
  totalProducts = 0;


  ngOnInit() {
    // TODO: Fetch products from API in future step
    this.products = Array.from({length: 12}, (_, i) => ({
      id: i+1,
      name: `Product ${i+1}`,
      price: (i+1)*100,
      image: 'https://placehold.co/200x250/138808/fff?text=IPL+Product',
      team: ['CSK','MI','RCB','KKR','SRH','DC','RR','PBKS','LSG','GT'][i%10]
    }));
    this.totalProducts = 48;
  }

  get totalPages(): number {
    return Math.ceil(this.totalProducts / this.pageSize);
  }

  onPageChange(page: number) {
    this.page = page;
    // TODO: Fetch new page from API
  }
}
<div class="product-grid-container">
  <div class="product-grid">
    <div class="product-card" *ngFor="let product of products">
      <img [src]="product.image" [alt]="product.name" [title]="product.name" />
      <div class="product-info">
        <h3>{{ product.name }}</h3>
        <p class="team">{{ product.team }}</p>
        <p class="price">₹{{ product.price }}</p>
      </div>
      <button class="buy-btn">Buy Now</button>
    </div>
  </div>
  <div class="pagination">
    <button (click)="onPageChange(page-1)" [disabled]="page === 1">Prev</button>
  <span>Page {{page}} of {{totalPages}}</span>
  <button (click)="onPageChange(page+1)" [disabled]="page === totalPages">Next</button>
  </div>
</div>
